import React from 'react'

const Quiz = () => {

  var paper = [
    { id: 1, question: 'Are you?', a: 'male', b: 'female', Rating: [20, 10, 10] },
    { id: 2, question: "What type of home do you live", a: 'Mansion (more than 6 bedrooms)', b: 'Detached', c: 'Cottage', d: 'Terrace ( 3 floors)', e: 'Terrace ( 2 floors)', f: 'Bungalow', g: 'Flat (Purpose build)', h: 'Flat (Conversion)', i: 'Town House', j: 'Do you own more that 1 home?' },
    { id: 3, question: "How well is your home insulated", option1: 'Very well', option2: `It's OK`, option3: 'Drafts everywhere', option4: `Don't know` },
    { id: 4, question: "How many adults (16+) live in your home", option1: 1, option2: 2, option3: 3, option4: 4, option5: 5, option6: '6+' }

  ];

  console.log(paper);

  return (
    <>



    </>
  )
}
export default Quiz;
